(8, 'trace output of square matrix of size n x n', 'Let A be a square matrix of size n x n. Consider the following program. What is the expected output?\n\n[[#code10]]', 7, 102, 3, 2, 1, 6, '_38ft1whqq', '2019-06-30 07:44:25', '2019-06-30 07:44:25'),
(9, 'How to declare array in java', 'Which of the following correctly declares an array?', 7, 102, 1, 2, 1, 6, '_h9k4kfvox', '2019-06-30 07:48:40', '2019-06-30 07:48:40'),
(10, 'linked list question', 'What does the following function do for a given Linked List with first node as head?\n\n [[#code11]]', 7, 102, 2, 2, 1, 6, '_5iwu57dwp', '2019-06-30 07:51:28', '2019-06-30 07:51:28'),
(11, 'linked list and array comparison', 'Which of the following points is/are true about Linked List data structure when it is compared with array', 7, 102, 1, 2, 1, 6, '_vyg7arz0w', '2019-06-30 07:52:51', '2019-06-30 07:53:05'),
(12, 'Linked list sorting', 'Which of the following sorting algorithms can be used to sort a random linked list with minimum time complexity?', 7, 102, 3, 2, 1, 6, '_ovkzxw3n0', '2019-06-30 07:54:26', '2019-06-30 07:54:42'),
(13, 'Reverse a linked list in java, implementation.', 'The following function reverse() is supposed to reverse a singly linked list. There is one line missing at the end of the function.\n[[#code12]]\nWhat should be added in place of \"/*ADD A STATEMENT HERE*/\", so that the function correctly reverses a linked list.', 7, 102, 3, 2, 1, 6, '_buo3nzql7', '2019-06-30 07:56:54', '2019-06-30 07:57:56'),
(14, 'Printing node in linked list java', 'What is the output of following function for start pointing to first node of following linked list? 1->2->3->4->5->6\n[[#code13]]', 7, 102, 3, 2, 1, 6, '_kzf234t5n', '2019-06-30 08:00:04', '2019-06-30 08:00:04'),
(15, 'Application of stack', 'Which one of the following is an application of Stack Data Structure?', 7, 102, 1, 2, 1, 6, '_lojsgvbu1', '2019-06-30 08:04:31', '2019-06-30 08:04:31'),
(16, 'About linked list implementation of stack', 'Which of the following is true about linked list implementation of stack?', 7, 102, 2, 2, 1, 6, '_mnukyedww', '2019-06-30 08:05:58', '2019-06-30 08:05:58'),
(17, 'Evaluating postfix expression', 'The result evaluating the postfix expression 10 5 + 60 6 / * 8 – is', 7, 102, 2, 2, 1, 6, '_h7d19lpkn', '2019-06-30 08:08:07', '2019-06-30 08:08:07'),
(18, 'Best algorithm for balanced parenthesis', 'The best data structure to check whether an arithmetic expression has balanced parenthesis is a', 7, 102, 1, 2, 1, 6, '_6mblcnaez', '2019-06-30 08:09:55', '2019-06-30 08:09:55'),
(19, 'Define binary tree', 'Which of the following is a true about Binary Trees', 7, 102, 1, 2, 1, 6, '_g7heaxjjh', '2019-06-30 08:36:09', '2019-06-30 08:36:09'),
(20, 'Number of leaf nodes', 'The number of leaf nodes in a rooted tree of n nodes, with each node having 0 or 3 children is:', 7, 102, 1, 2, 1, 6, '_dn6qkoji4', '2019-06-30 08:37:44', '2019-06-30 08:37:44'),
(21, 'Application queue', 'Which one of the following is an application of Queue Data Structure?', 7, 102, 1, 2, 1, 6, '_543gypgel', '2019-06-30 08:40:43', '2019-06-30 08:40:43'),
(22, 'How many stacks are needed to implement a queue', 'How many stacks are needed to implement a queue. Consider the situation where no other data structure like arrays, linked list is available to you.', 7, 102, 1, 2, 1, 6, '_99gxpp5fz', '2019-06-30 08:41:28', '2019-06-30 08:41:28'),
(23, 'What is the worst case time complexity for search', 'What is the worst case time complexity for search, insert and delete operations in a general Binary Search Tree?', 7, 102, 3, 2, 1, 6, '_39k5oiqnc', '2019-06-30 08:43:13', '2019-06-30 08:43:13'),
(24, 'Traversal outputs the data in sorted order', 'Which of the following traversal outputs the data in sorted order in a BST?', 7, 102, 2, 2, 1, 6, '_2qrkm8l5q', '2019-06-30 08:45:21', '2019-06-30 08:45:21'),
(25, 'binary search tree', 'Suppose the numbers 7, 5, 1, 8, 3, 6, 0, 9, 4, 2 are inserted in that order into an initially empty binary search tree. The binary search tree uses the usual ordering on natural numbers. What is the in-order traversal sequence of the resultant tree?', 7, 102, 3, 2, 1, 6, '_6wpfjdv86', '2019-06-30 08:46:32', '2019-06-30 08:46:32'),
(26, 'preorder traversal sequence of a binary search tree', 'The preorder traversal sequence of a binary search tree is 30, 20, 10, 15, 25, 23, 39, 35, 42. Which one of the following is the postorder traversal sequence of the same tree?', 7, 102, 3, 2, 1, 6, '_e5lxsvxvr', '2019-06-30 08:47:33', '2019-06-30 08:47:33'),
